Drop Trigger IF EXISTS ins_del;
DELIMITER ;;
CREATE TRIGGER ins_del BEFORE INSERT ON Deliverable FOR EACH ROW BEGIN
    IF (new.Deliverable_date < (select p.Project_starting from Project p where p.idProject=new.Project_idProject) or new.Deliverable_date > (select p.Project_ending from Project p where p.idProject=new.Project_idProject)) 
    THEN
    	#UPDATE org
    		SET new.Deliverable_date= date_add(date_add((select p.Project_starting from Project p where p.idProject=new.Project_idProject),INTERVAL new.idDeliverable % datediff( (select p.Project_starting from Project p where p.idProject=new.Project_idProject)  ,(select p.Project_ending from Project p where p.idProject=new.Project_idProject)) day),INTERVAL 10 day ) ;
    		
		#WHERE idorg = new.idorg;
     END IF;
     
  END;;



Drop Trigger IF EXISTS ins_res_proj;
DELIMITER ;;
CREATE TRIGGER ins_res_proj AFTER INSERT ON Project FOR EACH ROW BEGIN
        
    	UPDATE researcher
    		SET researcher_hire_date= date_sub(date_sub(new.project_ending, INTERVAL (mod(idresearcher, 12))  month),INTERVAL 20 day)
    		
		WHERE org_idorg = new.org_idorg and researcher_hire_date>new.project_ending and mod(idresearcher,2)=mod(new.idProject,2);
    IF (new.project_ending < (select r.researcher_hire_date from researcher r where r.idresearcher=new.researcher_idresearcher)) 
    THEN
    	UPDATE researcher
    		SET researcher_hire_date= date_sub(date_sub(new.project_ending, INTERVAL (mod(new.researcher_idresearcher,12))  month),INTERVAL 20 day)
    		
		WHERE idresearcher = new.researcher_idresearcher;
     END IF;
     IF (new.project_starting < (select r.researcher_hire_date from researcher r where r.idresearcher=new.researcher_ideval)) 
    THEN
    	UPDATE researcher
    		SET researcher_hire_date= date_sub(date_sub(new.project_starting, INTERVAL (mod(new.researcher_idresearcher,12)) month),INTERVAL 20 day)
    		
		WHERE idresearcher = new.researcher_ideval;
     END IF;
   
  
  END;;

DELIMITER ;


