DELIMITER ;;

CREATE TRIGGER upt_proj_resdates before update  on Project for each row 
 BEGIN 
 IF (new.org_idorg!=old.org_idorg) THEN 
 IF old.idProject in (select w.Project_idProject from works w) then
 SIGNAL sqlstate '45001' set message_text = "No way ! You cannot do this !";
 END IF;
 END IF;
 
 IF old.researcher_ideval!= new.researcher_ideval then
 SIGNAL sqlstate '45001' set message_text = "No way ! You cannot do this !";
 END IF;
 
 
 IF (new.org_idorg != 
(SELECT r.org_idorg
    FROM researcher r
    WHERE r.idresearcher= new.researcher_idresearcher))
     THEN SIGNAL sqlstate '45001' set message_text = "No way ! You cannot do this !";
     END IF;
    
 IF (new.org_idorg  = 
(SELECT r.org_idorg
