DELIMITER ;;

CREATE trigger upt_res after update on researcher for each row
BEGIN
IF (new.org_idorg!=old.org_idorg) THEN 
 IF new.idresearcher in (select w.researcher_idresearcher from works w) then
 SIGNAL sqlstate '45001' set message_text = "No way ! You cannot do this !";
END IF;
END IF;
IF EXISTS (select p.idProject from Project  p inner join works w on p.idProject=w.Project_idProject where  (w.researcher_idresearcher=new.idresearcher and p.Project_ending<new.researcher_hire_date) )
 then
 SIGNAL sqlstate '45001' set message_text = "No way ! You cannot do this !";
 END IF;
 IF EXISTS (select p.idProject from Project  p where (p.researcher_idresearcher=new.idresearcher and p.Project_ending<new.researcher_hire_date) )
 then
 SIGNAL sqlstate '45001' set message_text = "No way ! You cannot do this !";
 END IF;
 IF EXISTS (select p.idProject from Project  p where (p.researcher_ideval=new.idresearcher and p.EvalDate<new.researcher_hire_date) )
 then
 SIGNAL sqlstate '45001' set message_text = "No way  ! You cannot do this !";
 END IF;



 END ;;

